// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import Home from './components/Home';
import CreateMember from './components/CreateMember';
import CreateEvent from './components/CreateEvent';
import './App.css';

const App = () => {
  return (
    <Router>
      <div>
        <header>
          <nav>
            <ul>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/create-member">Create Member</Link></li>
              <li><Link to="/create-event">Create Event</Link></li>
            </ul>
          </nav>
          <h1 alt="Sports Association Management">Sports Association Management</h1>
        </header>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/create-member" component={CreateMember} />
          <Route path="/create-event" component={CreateEvent} />
        </Switch>
        <footer>
          <p>&copy; 2023 Sports Association Management</p>
        </footer>
      </div>
    </Router>
  );
};

export default App;
